import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open cart modal
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for cart modal to appear
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_opened.png'));

    // Check if cart has items
    const emptyCart = await page.$('.empty-cart');
    if (emptyCart) {
      return {
        success: false,
        action: "Remove item from cart",
        extractedData: { removed: false, message: "Cart is empty" },
        screenshots,
        error: null
      };
    }

    // Remove first item from cart
    await page.waitForSelector('.remove-item', { timeout: 5000 });
    await page.click('.remove-item');

    // Wait for cart to update
    await page.waitForTimeout(1000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_item_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_item_removed.png'));

    // Verify removal by checking cart count
    const cartText = await page.textContent('.cart');
    const cartCount = parseInt(cartText) || 0;

    return {
      success: true,
      action: "Removed one item from the cart",
      extractedData: {
        removed: true,
        cartCountAfterRemoval: cartCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to remove item from cart",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
